import { BrowserRouter,Routes,Router, Route } from "react-router-dom";
import Shop from "./Shop";

function App(){
  return(
    <div>

    <BrowserRouter>

    <Routes>
      <Route path="/" element={<Shop/>}/>
    </Routes>

    </BrowserRouter>



    </div>  
  )
}
export default App
